import logo from './logo.svg';
import './App.css';
import Customer from './components/Customer'

const coustomers = [
  {
  'id': 1,
  'image': 'htttps://placeimg.com/64/64/1',
  'name': '킹석중',
  'birthday': '981112',
  'gender': '남자',
  'job': '대통령'
  },
  {
    'id': 2,
    'image': 'htttps://placeimg.com/64/64/2',
    'name': '김용철',
    'birthday': '980119',
    'gender': '개',
    'job': '애완용'
  },
  {
      'id': 3,
      'image': 'htttps://placeimg.com/64/64/3',
      'name': '이호영',
      'birthday': '980224',
      'gender': '남자',
      'job': '비서'
  }
]

function App() {
  return (
    <div>
    <Customer
      id={coustomers[0].id}
      image={coustomers[0].image}
      name={coustomers[0].name}
      birthday={coustomers[0].birthday}
      gender={coustomers[0].gender}
      job={coustomers[0].job}
    />
    <Customer
      id={coustomers[1].id}
      image={coustomers[1].image}
      name={coustomers[1].name}
      birthday={coustomers[1].birthday}
      gender={coustomers[1].gender}
      job={coustomers[1].job}
    />
    <Customer
      id={coustomers[2].id}
      image={coustomers[2].image}
      name={coustomers[2].name}
      birthday={coustomers[2].birthday}
      gender={coustomers[2].gender}
      job={coustomers[2].job}
    />
    </div>
  );
}

export default App;
